function complexLogic(e){let t=0;for(let o=0;o<e.length;o++)e[o]>10?t+=2*e[o]:e[o]>5?t+=3*e[o]:t+=e[o];t%2==0?t*=2:t-=5;const o=[];for(let t=0;t<e.length;t++)e[t]%2==0&&o.push(e[t]);return{total:t,evens:o,message:"Complex logic executed successfully!"}}const input=[3,7,12,5,8,4,11,6],output=complexLogic(input);console.log(output);